import React from "react";
import './Home.css';
function Home() {
    return (
        <div className="border-box">
            <form>
                <label>
                    First Name:
                    <br/>
                <input type="text" name="name" />
                </label>
                <input type="submit" value="Submit" />
            </form>
        </div>
    );
}

export default Home;
